import * as React from 'react';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';

export default function BST() {
  return (
    <Card sx={{ maxWidth: 345 }} >
      <CardMedia
        component="img"
        height="140"
        image="src/Components/BST/BST.png"
      />
      <CardContent>
        <Typography gutterBottom variant="h5" component="div">
          Binary Search Tree 
        </Typography>
        <Typography variant="body2" color="text.secondary">
        In computer science, a binary search tree, also called an 
        ordered or sorted binary tree, is a rooted binary tree data
         structure with the key of each internal node being greater
          than all the keys in the respective node's left subtree and less than the ones in its right subtree.
        </Typography>
      </CardContent>

    </Card>
  );
}
